import React from 'react';

class Message extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      items:['fake1','fk2','f3']
    }
  }

  render() {
    return (
      <div>
      <ul>
        {this.state.items.map( (item,idx) => {
          <li key={idx}> {item} </li>
        })}
      </ul>
      </div>
    );
  }
}

export default Message;
